INSERT INTO `text_widgets` (`id`, `key`, `image`, `title`, `content`, `active`, `created_at`, `updated_at`) VALUES
(1, 'about-us-sidebar', NULL, 'about tes ', 'tes saja oke', 1, '2023-06-06 02:03:53', '2023-06-23 23:44:49'),
(2, 'header', NULL, 'eko header', 'tess header', 1, '2023-06-06 02:46:01', '2023-06-06 02:46:01'),
(3, 'about-page', 'Ygu4tDaBvz8NEMwaMh9BAoonm35yUE-metacHJvamVjdGVycC5wbmc=-.png', 'ABout Us', '<h2><a href=\"https://laravel.com/docs/10.x#your-first-laravel-project\">Your First Laravel Project</a></h2><p>Before creating your first Laravel project, you should ensure that your local machine has PHP and <a href=\"https://getcomposer.org/\"><span style=\"text-decoration: underline;\">Composer</span></a> installed. If you are developing on macOS, PHP and Composer can be installed via <a href=\"https://brew.sh/\"><span style=\"text-decoration: underline;\">Homebrew</span></a>. In addition, we recommend <a href=\"https://nodejs.org/\"><span style=\"text-decoration: underline;\">installing Node and NPM</span></a>.</p><p>After you have installed PHP and Composer, you may create a new Laravel project via the Composer create-project command:</p><pre>composer create-project laravel/laravel example-app</pre><p><br></p><p>Or, you may create new Laravel projects by globally installing the Laravel installer via Composer:</p><pre>composer global require laravel/installer laravel new example-app</pre><p><br></p><p>After the project has been created, start Laravel\'s local development server using the Laravel\'s Artisan CLI serve command:</p><pre>cd example-app php artisan serve</pre><p><br></p><p>Once you have started the Artisan development server, your application will be accessible in your web browser at http://localhost:8000. Next, you\'re ready to <a href=\"https://laravel.com/docs/10.x#next-steps\"><span style=\"text-decoration: underline;\">start taking your next steps into the Laravel ecosystem</span></a>. Of course, you may also want to <a href=\"https://laravel.com/docs/10.x#databases-and-migrations\"><span style=\"text-decoration: underline;\">configure a database</span></a>.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image&quot;,&quot;height&quot;:40,&quot;url&quot;:&quot;https://laravel.com/img/callouts/lightbulb.min.svg&quot;,&quot;width&quot;:28}\" data-trix-content-type=\"image\" class=\"attachment attachment--preview\"><img src=\"https://laravel.com/img/callouts/lightbulb.min.svg\" width=\"28\" height=\"40\"><figcaption class=\"attachment__caption\"></figcaption></figure></p><blockquote>If you would like a head start when developing your Laravel application, consider using one of our <a href=\"https://laravel.com/docs/10.x/starter-kits\"><span style=\"text-decoration: underline;\">starter kits</span></a>. Laravel\'s starter kits provide backend and frontend authentication scaffolding for your new Laravel application.</blockquote><h2><a href=\"https://laravel.com/docs/10.x#laravel-and-docker\">Laravel &amp; Docker</a></h2><p>We want it to be as easy as possible to get started with Laravel regardless of your preferred operating system. So, there are a variety of options for developing and running a Laravel project on your local machine. While you may wish to explore these options at a later time, Laravel provides <a href=\"https://laravel.com/docs/10.x/sail\"><span style=\"text-decoration: underline;\">Sail</span></a>, a built-in solution for running your Laravel project using <a href=\"https://www.docker.com/\"><span style=\"text-decoration: underline;\">Docker</span></a>.</p><p>Docker is a tool for running applications and services in small, light-weight \"containers\" which do not interfere with your local machine\'s installed software or configuration. This means you don\'t have to worry about configuring or setting up complicated development tools such as web servers and databases on your local machine. To get started, you only need to install <a href=\"https://www.docker.com/products/docker-desktop\"><span style=\"text-decoration: underline;\">Docker Desktop</span></a>.</p><p>Laravel Sail is a light-weight command-line interface for interacting with Laravel\'s default Docker configuration. Sail provides a great starting point for building a Laravel application using PHP, MySQL, and Redis without requiring prior Docker experience.<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image&quot;,&quot;height&quot;:40,&quot;url&quot;:&quot;https://laravel.com/img/callouts/lightbulb.min.svg&quot;,&quot;width&quot;:28}\" data-trix-content-type=\"image\" class=\"attachment attachment--preview\"><img src=\"https://laravel.com/img/callouts/lightbulb.min.svg\" width=\"28\" height=\"40\"><figcaption class=\"attachment__caption\"></figcaption></figure></p><blockquote>Already a Docker expert? Don\'t worry! Everything about Sail can be customized using the docker-compose.yml file included with Laravel.</blockquote><h3><a href=\"https://laravel.com/docs/10.x#getting-started-on-macos\">Getting Started On macOS</a></h3><p>If you\'re developing on a Mac and <a href=\"https://www.docker.com/products/docker-desktop\"><span style=\"text-decoration: underline;\">Docker Desktop</span></a> is already installed, you can use a simple terminal command to create a new Laravel project. For example, to create a new Laravel application in a directory named \"example-app\", you may run the following command in your terminal:</p><pre>curl -s \"https://laravel.build/example-app\" | bash</pre><p><br></p><p>Of course, you can change \"example-app\" in this URL to anything you like - just make sure the application name only contains alpha-numeric characters, dashes, and underscores. The Laravel application\'s directory will be created within the directory you execute the command from.</p><p>Sail installation may take several minutes while Sail\'s application containers are built on your local machine.</p><p>After the project has been created, you can navigate to the application directory and start Laravel Sail. Laravel Sail provides a simple command-line interface for interacting with Laravel\'s default Docker configuration:</p><pre>cd example-app ./vendor/bin/sail up</pre><p><br></p><pre>Once the application\'s Docker containers have been started, you can access the application in your web browser at: <a href=\"http://localhost/\"><span style=\"text-decoration: underline;\">http://localhost</span></a>.</pre><p><br></p>', 1, '2023-06-24 00:47:49', '2023-06-24 00:47:49');
